import React from 'react';

function Input() {
  const [nome, setNome] = React.useState('');

  return (
    <div>
      <input
        width={'50%'}
        type="text"
        nome="fnome"
        value={nome}
        onChange={(e) => setNome(e.target.value)}
      />
    </div>
  );
}

export default Input;
